// import React from "react";
// import '../Style.css'


import React, { useRef } from "react";
import '../Style.css';

const ContactForm = () => {
    const nameRef = useRef(null);
    const emailRef = useRef(null);
    const messageRef = useRef(null);

    const handleSubmit = (e) => {
        e.preventDefault();
        const formData = {
            name: nameRef.current.value,
            email: emailRef.current.value,
            message: messageRef.current.value
        };
        // Handle form submission logic here
        console.log('Form data:', formData);
    };

    return (
        <div className="contact-form-container">

            <div className="row">
                <div className="hdn">
                    <h1>CONTACT US</h1>
                    <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s.</p>
                </div>
            </div>

            <div className="row">
                <div className="col-md-6">
            <form onSubmit={handleSubmit}>
                <label htmlFor="name">Name</label>
                <input 
                    type="text" 
                    id="name" 
                    name="name" 
                    ref={nameRef} 
                    required 
                />
                


                <label htmlFor="email">Email</label>
                <input 
                    type="email" 
                    id="email" 
                    name="email" 
                    ref={emailRef} 
                    required 
                />
                


                <label htmlFor="message">Message</label>
                <textarea 
                    id="message" 
                    name="message" 
                    rows="5" 
                    ref={messageRef} 
                    required 
                />
                
                <button type="submit">Submit</button>
            </form>
            </div>


            <div className="col-md-6">

                <div className="row">
                    <div className="col-md-7">
                        <div className="con-lt">
                           
                        <p style={{display:'flex'}}> <img style={{width:'21px', height:'24px'}} src={process.env.PUBLIC_URL+'mapi.png'} alt="img" />&nbsp; 1/F lorem pesum, 138 Shau &nbsp; &nbsp; &nbsp; &nbsp;  Kei Road Sai Wan Ho, Dummy</p>
                        <p> <img src={process.env.PUBLIC_URL+'phone.png'} alt="img" />&nbsp; +99-566-555-55</p>
                        <p> <img src={process.env.PUBLIC_URL+'mail.png'} alt="img" />&nbsp; Example@gmail.com</p>
                <div className="media">
                <img src={process.env.PUBLIC_URL+'youtube.png'} alt="img" />
                <img src={process.env.PUBLIC_URL+'Instagram.png'} alt="img" />
                <img src={process.env.PUBLIC_URL+'Facebook.png'} alt="img" />
                <img src={process.env.PUBLIC_URL+'x.png'} alt="img" />
                </div>

                        </div>
                    </div>
                    
                    <div className="col-md-5">

                        <div className="fly">
                <img src={process.env.PUBLIC_URL+'fly.png'} alt="img" />
                            </div>                    

                    </div>




                </div>

            </div>

            </div>


        </div>
    );
};

export default ContactForm;
